import React from 'react'
import classnames from "classnames";

import {
  Col,
  Container,
  Nav,
  NavItem,
  NavLink,
  Row,
  TabContent,
  TabPane
} from "reactstrap";

import {DatePicker,Divider,Form,Input,Item,Badge,Button,Icon,Radio,Slider,Select} from 'antd'

import { Home, Settings, MessageSquare,Users,GitMerge } from "react-feather";

const PopoverNodeDetail = (props) => {
  return (
    <div>
      {props.props.node.data.task_title}
      {props.props.node.data.children.length}
      {props.props.node.data.task_desc}
    </div>
  )
}

export default PopoverNodeDetail
